import React, { FC, useState } from "react";
import RadioButton from "./RadioButton";
import Button from "react-bootstrap/Button";
import "./DecideReel.css";
import { DecideReelTypeProp } from "../../types/ReelTypes";
import { ClipTypeObj } from "../../types/ClipTypes";

const SelectClips: FC<ClipTypeObj> = ({
  clipName = "",
  clipDescription = "",
  clipStandard = "",
  clipDefinition = "",
  clipStartTimecode = "",
  clipEndTimecode = "",
}) => {
  const [reelName, setReelName] = useState("");

  const nameHandler = (event: React.ChangeEvent<HTMLInputElement>) => {
    setReelName(event.target.value);
    console.log("Name is: ", event.target.value);
  };
  return (
    <div className="container">
      <div className="name-container">
        Name:{" "}
        <input
          type="text"
          name="name"
          onChange={nameHandler}
          value={reelName}
        />
      </div>
      <div className="radio-container">
        <RadioButton />
      </div>
      <Button>Select Clips</Button>
    </div>
  );
};

export default SelectClips;
